const d2r = d => d * Math.PI / 180.0;

const clamp = (val, start, end) => {
    if (start > val) {
        return start;
    } else if (val > end) {
        return end;
    } else {
        return val;
    }
}

class Random {
    static range(min, max) {
        return min + (max - min) * Math.random();
    }

    static normal() {
        return Math.random();
    }
}

class Vector {
    constructor(x, y, z) {
        this.x = x
        this.y = y
        this.z = z
    }

    static default() {
        return new Vector(0, 0, 0);
    }

    static randomInUnitBox() {
        return new Vector(
            Random.range(-1.0, 1.0),
            Random.range(-1.0, 1.0),
            Random.range(-1.0, 1.0),
        );
    }

    static randomUnitDisk() {
        while (true) {
            let p = new Vector(Random.range(-1.0, 1.0), Random.range(-1.0, 1.0), 0.0);
            if (p.lengthSquared < 1.0) {
                return p;
            }
        }
    }

    static randomUnit() {
        let a = Random.range(0.0, (2.0 * Math.PI));
        let z = Random.range(-1.0, 1.0);
        let r = Math.sqrt(1.0 - z * z);
        return new Vector(r * Math.cos(a), r * Math.sin(a), z);
    }

    static randomInUnitSphere() {
        while (true) {
            let p = Vector.randomInUnitBox();
            if (p.lengthSquared < 1.0) {
                return p;
            }
        }
    }

    clone() {
        return new Vector(this.x, this.y, this.z);
    }

    plus(b) {
        return new Vector( //
            this.x + b.x,
            this.y + b.y,
            this.z + b.z
        )
    }

    minus(b) {
        return new Vector( //
            this.x - b.x,
            this.y - b.y,
            this.z - b.z
        )
    }

    timesScalar(s) {
        return new Vector( //
            this.x * s,
            this.y * s,
            this.z * s
        )
    }

    cross(b) {
        return new Vector(
            (this.y * b.z - this.z * b.y),
            (this.z * b.x - this.x * b.z),
            (this.x * b.y - this.y * b.x)
        )
    }

    dotProduct(b) {
        return (this.x * b.x) + (this.y * b.y) + (this.z * b.z)
    }

    dotEach(b) {
        return new Vector(
            this.x * b.x,
            this.y * b.y,
            this.z * b.z,
        );
    }

    get lengthSquared() {
        return this.getLengthSquared();
    }

    getLengthSquared() {
        return this.x * this.x + this.y * this.y + this.z * this.z;
    }

    get length() {
        return this.getLength()
    }

    getLength() {
        return Math.sqrt(this.lengthSquared);
    }

    unit() {
        const factor = 1 / this.getLength();

        return new Vector(
            this.x * factor,
            this.y * factor,
            this.z * factor
        )
    }

    rotate(axis, angle) {
        angle = angle / 180 * Math.PI; // Degrees to radians

        const sin = Math.sin(angle);
        const cos = Math.cos(angle);

        return this.applyTransformationMatrix([
            [
                ('x' === axis ? 1 : cos).toFixed(decimals),
                ('z' === axis ? sin : 0).toFixed(decimals),
                ('y' === axis ? -1 * sin : 0).toFixed(decimals)
            ],
            [
                ('z' === axis ? -1 * sin : 0).toFixed(decimals),
                ('y' === axis ? 1 : cos).toFixed(decimals),
                ('x' === axis ? sin : 0).toFixed(decimals)
            ],
            [
                ('y' === axis ? sin : 0).toFixed(decimals),
                ('x' === axis ? -1 * sin : 0).toFixed(decimals),
                ('z' === axis ? 1 : cos).toFixed(decimals)
            ]
        ])
    }

    isEqualTo(b) {
        return (this.x === b.x)
            && (this.y === b.y)
            && (this.z === b.z)
    }

    between(end, slide) {
        let a = this.timesScalar(1.0 - slide);
        let b = end.timesScalar(slide);
        return new Vector(a.x + b.x, a.y + b.y, a.z + b.z);
    }

    color(_u, _v, _point) {
        return this.clone();
    }

    toColor(samples, gamma) {
        let color = this.timesScalar(1 / samples);
        if (gamma) {
            color.x = Math.sqrt(color.x);
            color.y = Math.sqrt(color.y);
            color.z = Math.sqrt(color.z);
        }
        return new Vector(
            clamp(color.x, 0.0, 1.0),
            clamp(color.y, 0.0, 1.0),
            clamp(color.z, 0.0, 1.0),
        )
    }

    reverse() {
        this.x = -this.x;
        this.y = -this.y;
        this.z = -this.z;
    }
}

const Point = Vector;

class Ray {
    constructor(origin, dir) {
        this.origin = origin;
        this.dir = dir;
    }

    positionAfter(unit) {
        return this.origin.plus(this.dir.timesScalar(unit));
    }
}

class ScatterRecord {
    constructor(color, ray) {
        this.color = color;
        this.ray = ray;
    }
}

